    pub struct EventData<
        Arg1: EventArgument,
        Arg2: EventArgument,
        Arg3: EventArgument,
        Arg4: EventArgument,
        Arg5: EventArgument,
    > {
        pub type_id: u64,
        pub arg1: <Arg1 as EventArgument>::Type,
        pub arg2: <Arg2 as EventArgument>::Type,
        pub arg3: <Arg3 as EventArgument>::Type,
        pub arg4: <Arg4 as EventArgument>::Type,
