pub unsafe fn get_d3d11_device() -> Option<InterfaceRef<'static, ID3D11Device>> {
    unsafe {
        GraphicsEngine::get()
            .and_then(|ge| ge.graphics_device.as_ref())
            .and_then(|d| {
                let raw = std::ptr::NonNull::new(
                    d.device as *mut std::os::raw::c_void
                )?;
                Some(InterfaceRef::from_raw(raw))
            })
    }
}
