impl HashString {
        pub unsafe fn from_cstr(str: impl AsRef<std::ffi::CStr>) -> Self {
            unsafe {
                let mut instance = std::mem::MaybeUninit::<Self>::uninit();
                (*instance.as_mut_ptr()).constructor(str.as_ref().as_ptr());
                instance.assume_init()
            }
        }

        pub const fn from_u32(hash: u32) -> Self {
            Self { hash }
        }
    }

    impl From<u32> for HashString {
        fn from(hash: u32) -> Self {
            Self { hash }
        }
    }

